import React, { useState } from 'react';

const AuthContex = React.createContext({
  token: '',
  isLoggedIn: false,
  login: (token) => {},
  logout: () => {}
});

const AuthContextProvider = (props) => {
  return <AuthContex.Provider>{props.children}</AuthContex.Provider>
}
